import rotulosPersonalizadosDefault from './rotulosPersonalizadosDefault';
import VueI18n from 'vue-i18n';
var rotulosPersonalizados = localStorage.getItem('rotulosPersonalizados') && JSON.parse(localStorage.getItem('rotulosPersonalizados')) || rotulosPersonalizadosDefault;
window.$i18n = new VueI18n({
  locale: 'rotulosPersonalizados',
  messages: {
    rotulosPersonalizados: rotulosPersonalizados
  }
});
export default {
  rotulosPersonalizados: rotulosPersonalizados
};
